import './info.css';
import { Component } from 'react';

export default class Info extends Component {
  constructor() {
    super();
  }
  get_info = (name) => {
    fetch('https://api.mydomain.com')
      .then(response => response.json())
      .then(data => this.setState({ data }));
  }
  render() {
    return (
      <div className="info">

      </div>
    )
  }
}
